.github-IssueishTooltip {
  max-width: 500px;
  text-align: left;
}
.github-IssueishTooltip .issueish-badge-and-link {
  padding-bottom: 10px;
}
.github-IssueishTooltip .issueish-badge {
  align-self: flex-start;
  flex-shrink: 0;
  margin-right: 10px;
  font-weight: bold;
  text-transform: capitalize;
  border-radius: 0.125rem;
}
.github-IssueishTooltip .issueish-badge.open {
  color: white;
  background-color: #28a745;
}
.github-IssueishTooltip .issueish-badge.closed {
  color: white;
  background-color: #dc3545;
}
.github-IssueishTooltip .issueish-badge.merged {
  color: white;
  background-color: #6f42c1;
}
.github-IssueishTooltip .issueish-title {
  margin: 0;
  padding-bottom: 10px;
  line-height: 1.2;
  display: block;
  overflow: hidden;
  text-overflow: ellipsis;
  white-space: nowrap;
}
.github-IssueishTooltip .author-avatar {
  margin-right: 10px;
  width: 20px;
  height: 20px;
}
